                            <div class="container">
                    <div class="exc-container">
                        <div class="muscle-text bd-bot exercise-list-start">
                            <h3><strong>Clavicular Head Of Pectoralis Major</strong></h3><p>The <a href="https://www.ncbi.nlm.nih.gov/books/NBK525991/" target="_blank" rel="nofollow noopener">pectoralis major</a> makes up a significant part of the chest musculature. It is divided into three heads: the clavicular head, the sternal head, and the abdominal head. The clavicular head sits at the uppermost part of the pectoralis major, just beneath the collarbone.</p><p>The clavicular head works with the other heads of the pectoralis major to actively support respiratory movements and stabilize the ribs. During the dumbbell Svend press, it assists in flexing the arm when extended bringing the dumbbell back into the chest.</p><p>Studies show that the pectoralis major can reach maximum voluntary contraction of approximately <a href="https://www.ncbi.nlm.nih.gov/pmc/articles/PMC7579505/" target="_blank" rel="nofollow noopener">25%–30%</a> during elbow flexion against resistance. This demonstrates how hard the muscle is working when contracting during this exercise.</p><h3><strong>Sternal Head Of Pectoralis Major</strong></h3><p>The <a href="https://www.ncbi.nlm.nih.gov/books/NBK525991/" target="_blank" rel="nofollow noopener">sternal head</a> is another head of the pectoralis major, originating in the mid-region beneath the clavicular head. It also activates during respiratory movements and functions to protect and support the rib cage.</p><p>The sternal head primarily functions to extend the arm from a flexed position. It engages during the dumbbell Svend press to extend the arm and push the dumbbell away from the body. It also provides shoulder support and stabilizes the elbow joint throughout the movement.</p>                        </div>
                    </div>
                </div>
                                        <section class="exc-secondary">
                <div class="container">
                    <div class="exc-container bd-bot">
                        <div class="muscle-title">
