                                    <p class="has-medium-font-size">Biceps Long Head </p>
                                    <p class="has-small-font-size"><p>Most outside part of your bicep.The front of your upper arm.</p></p>
                                </div>
                                                            <div class="secondary-item muscle-item">
                                    <div class="muscle-img">
                                        <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Biceps-Short-Head-.png" alt="">
                                    </div>
                                    <p class="has-medium-font-size">Biceps Short Head </p>
                                    <p class="has-small-font-size"><p>Most inside portion of the biceps. Located at the front of your upper arm closest to your chest.</p></p>
                                </div>
                                                            <div class="secondary-item muscle-item">
                                    <div class="muscle-img">
                                        <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Triceps-Lateral-Heads.png" alt="">
                                    </div>
                                    <p class="has-medium-font-size">Triceps Lateral Heads</p>
                                    <p class="has-small-font-size"><p>Muscles located on the back of your arm between your shoulder and elbow.</p></p>
                                </div>
                                                            <div class="secondary-item muscle-item">
                                    <div class="muscle-img">
                                        <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Triceps-Medial-Heads.png" alt="">
                                    </div>
                                    <p class="has-medium-font-size">Triceps Medial Heads</p>
                                    <p class="has-small-font-size"><p>Small muscles located at the back of your arms. Deep to the triceps long heads between the shoulder and elbow.</p></p>
                                </div>
                                                            <div class="secondary-item muscle-item">
                                    <div class="muscle-img">
                                        <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Triceps-Long-Heads.png" alt="">
                                    </div>
                                    <p class="has-medium-font-size">Triceps Long Heads</p>
                                    <p class="has-small-font-size"><p>Large muscles located at the back of your arms between your shoulder and elbow. Most outside portion of the tricep.</p></p>
                                </div>
                                                            <div class="secondary-item muscle-item">
                                    <div class="muscle-img">
                                        <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Wrist-Flexors.png" alt="">
                                    </div>
                                    <p class="has-medium-font-size">Wrist Flexors</p>
                                    <p class="has-small-font-size"><p>Muscles that span the inside of your lower arm, between your elbow and wrist palm side up.</p></p>
                                </div>
                                                            <div class="secondary-item muscle-item">
                                    <div class="muscle-img">
                                        <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Wrist-Extensors.png" alt="">
                                    </div>
                                    <p class="has-medium-font-size">Wrist Extensors</p>
                                    <p class="has-small-font-size"><p>Muscles that make up the back portion of your lower arm, between your elbow and wrist.</p></p>
                                </div>
                                                            <div class="secondary-item muscle-item">
                                    <div class="muscle-img">
                                        <img src="https://www.endomondo.com/wp-content/uploads/2024/06/Anterior-Deltoid.png" alt="">
                                    </div>
                                    <p class="has-medium-font-size">Anterior Deltoid</p>
                                    <p class="has-small-font-size"><p>Muscles located at the front of your shoulder region</p></p>
