                    </div>
                </div>
            </section>
                            <div class="container">
                    <div class="exc-container">
                        <div class="muscle-text bd-bot exercise-list-start">
                            <h3><strong>Anterior Deltoid</strong></h3><p>The <a href="https://www.ncbi.nlm.nih.gov/books/NBK537056/" target="_blank" rel="nofollow noopener">anterior deltoid</a> muscle originates from the lateral part of the collarbone and inserts into the shoulder joint of the upper arm bone. It forms the large rounded contour of the shoulder and is active during shoulder flexion and extension. It functions to raise the arm forward, move the arm away from the body, and rotate the shoulder.</p><p>The anterior deltoid is secondarily activated during the dumbbell Svend press to help stabilize the shoulder joint. It also assists the triceps to maintain controlled movements during the extension and stabilize the upper arms. </p><h3><strong>Triceps Lateral Heads</strong></h3><p>The <a href="https://www.ncbi.nlm.nih.gov/books/NBK536996/" target="_blank" rel="nofollow noopener">triceps lateral head</a> is one of the three muscles that make up the triceps brachii. It originates from the back of the humerus and is inserted into the forearm at the elbow. It also supports the elbow joint during the initial phase of elbow extension.</p><p>The dumbbell Svend press secondarily activates this muscle during the eccentric contraction, or muscle lengthening, phase of the exercise. It works to extend the forearm and stabilize the elbow joint maintaining tension throughout which increases the muscle’s engagement.</p><h3><strong>Triceps Medial Heads</strong></h3><p>The <a href="https://www.ncbi.nlm.nih.gov/books/NBK536996/" target="_blank" rel="nofollow noopener">triceps medial head</a> is the second of the muscles that make up the triceps brachii. Like the lateral head, it originates from the back side of the humerus extending down to the elbow joint. The triceps medial head is active in extending the forearm and stabilizing the elbow.</p><p>The dumbbell Svend press engages the triceps medial head throughout the exercise to stabilize the shoulder joint. During the extension outward, the triceps contracts, and the medial head provides support. </p><h3><strong>Triceps Long Heads</strong></h3><p>The <a href="https://www.ncbi.nlm.nih.gov/books/NBK536996/" target="_blank" rel="nofollow noopener">triceps long head</a> is the third muscle that makes up the triceps brachii. It originates from the underarm region of the shoulder blade and, like the other tricep heads, inserts into the forearm. It is the only tricep head that crosses the shoulder joint, assisting in both shoulder and elbow extension.</p><p>This muscle activates during upper-arm extension, eliciting engagement during the dumbbell Svend press to extend the arms out. The exercise also stretches the muscles to maintain tension against the weight of the dumbbell.</p><h3><strong>Biceps Long Head</strong></h3><p>The <a href="https://www.researchgate.net/publication/346917065_Variations_of_Biceps_Brachii_Muscle_and_its_Clinical_Importance" target="_blank" rel="nofollow noopener">biceps long head</a> is one of two muscles that make up the biceps brachii. It is the longer, outer head. It originates from the humerus (upper arm) and is inserted into the ulna (forearm).</p><p>It primarily functions to flex the elbow, adduct the shoulder, and inwardly rotate the arm. This is where you bring your forearm in, arm away, and rotate your arm towards your body.</p><p>The dumbbell Svend press targets the biceps long head as it flexes the elbow when pushing the dumbbell away. It also works to maintain tension and shoulder stability throughout the full range of motion. </p><h3><strong>Biceps Short Head</strong></h3><p>The <a href="https://pubmed.ncbi.nlm.nih.gov/30137823/" target="_blank" rel="nofollow noopener">biceps short head</a> makes up the rest of the biceps brachii. Like the biceps long head, it originates from the upper arm bone and inserts into the forearm. It works with the biceps long head to flex the elbow, internally rotate the forearm, and stabilize the shoulder.</p><p>The dumbbell Svend press activates the biceps short head to support the shoulders throughout the movement. It also helps stabilize the elbow joint when extending the arms outward to maintain control.</p><h3><strong>Wrist Flexors</strong></h3><p>The <a href="https://www.ncbi.nlm.nih.gov/books/NBK545198/" target="_blank" rel="nofollow noopener">wrist flexors</a> are a group of muscles located on the inside of your forearm. They primarily function to flex your wrist and fingers. They’re essential for activities requiring grip strength and forearm stability.</p><p>The wrist flexors act as secondary movers during the dumbbell Svend press. They work to stabilize the wrist joints while keeping a strong hold on the dumbbell.</p><h3><strong>Wrist Extensors</strong></h3><p>The wrist extensors are a group of muscles on the back side of the forearm. They extend the wrist and fingers while supporting grip strength and forearm stabilization. Alongside the wrist flexors, they determine <a href="https://www.mdpi.com/2075-1729/12/2/188" target="_blank" rel="nofollow noopener">wrist joint function and loading</a>.</p><p>The dumbbell Svend press activates the wrist extensors as wrist stabilizers when extending the dumbbell outward. They support the wrist joint to prevent straining throughout the movement.</p>                        </div>
                    </div>
                </div>
